import React from 'react'
import './HomePage.css'
import logo from '../../logo.svg'

const HomePage = () => {
  const listMenu = [
    {
      id: 1,
      title: 'Home',
    },
    {
      id: 2,
      title: 'Course',
    },
    {
      id: 3,
      title: 'Become a teacher',
    },
    {
      id: 4,
      title: 'Account',
    },
  ]

  const menuComponent = () => {
    return (
      <ul>
        {listMenu.map((item) => <li key={item.id}>
          {item.title}
        </li>)}
      </ul>
    )
  }
  return (
    <div className="App">
      <header className="App-header">
        <img src={logo} className="App-logo" alt="logo" />
        <div className="App-header-menu">
          <ul className="App-header-menu-item">
            {listMenu.map((item) => <li key={item.id}>
              <a
                href="#"
              >
                {item.title}
              </a>
            </li>)}
          </ul>
        </div>
      </header>

    </div>
  )
}

export default HomePage
